// Import các thành phần cần thiết từ react-router-dom
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Signin from '../components/account/signin'; 
import Signup from '../components/account/signup';
import { ForgetPass } from '../components/account/forgetpass'; 
import HomeGuest from '../page/homeGuest';
import HomeUsers from '../page/homeUser';
import AdminUsers from '../page/adminUsers';
import AdminVideo from '../page/adminVideo';

// Hàm Router
export const AppRouter = () => {
  return (
    <Router>
      <Routes>
        <Route path="/signin">
          <Signin />
        </Route>
        <Route path="/signup">
          <Signup />
        </Route>
        <Route path="/repass">
          <ForgetPass />
        </Route>
        <Route path="/">
          <HomeGuest />
        </Route>
        <Route path="/user">
          <HomeUsers />
        </Route>
        <Route path="/admin/user">
          <AdminUsers />
        </Route>
        <Route path="/admin/video">
          <AdminVideo />
        </Route>
      </Routes>
    </Router>
  );
}

export default AppRouter;
